export default function Fanart (){

  return (
      <div>
        <div>
          <p style={pagesHeaderStyle}>fan art</p>
          <p style={subtext}>please give some time for drawings to load, thanks!</p>
        </div>
        <PhotoAlbum 
          layout="columns" 
          // padding='10' 
          // columns={3} 
          minColumns = {3}
          photos={fanartPhotos} 
        />
      </div>
  )
}
